import React from "react";

const Header = () => (
  <header className="fixed w-full top-0 bg-white shadow-sm z-50">
    <nav className="container mx-auto flex justify-between items-center py-6 px-8">
      <span className="font-bold text-2xl text-[#3A3A3A]">Muanfun</span>
      <ul className="flex gap-12 text-[#3A3A3A] text-lg">
        <li><a href="#hero" className="hover:text-blue-600">Home</a></li>
        <li><a href="#about" className="hover:text-blue-600">About</a></li>
        <li><a href="#skills" className="hover:text-blue-600">Skills</a></li>
        <li><a href="#projects" className="hover:text-blue-600">Projects</a></li>
        <li><a href="#contact" className="hover:text-blue-600">Contact</a></li>
      </ul>
    </nav>
  </header>
);

export default Header;
